.article-wrap {
  padding: 1rem;
  .article-header {
    margin-bottom: 1rem;
  }
  .article-title {
    color: #444;
    border-bottom: 2px dotted #efefef;
    font-size: 1.6rem;
    &:hover {
      border-bottom: 2px dotted #777;
      &::after {
        display: none;
      }
    }
  }

  .article-meta {
    margin-bottom: 1rem;
    color: #999;
    font-size: 0.8rem;
    a {
      &:hover {
        &::after {
          display: none;
        }
      }
    }
    .article-category {
      margin-right: 1rem;
      .icon {
        margin-right: 0.2rem;
        color: #999;
      }
      .article-category-link {
        color: #999;
      }
    }
    .word_count {
      margin-right: 1rem;
    }
    .article-date {
      color: #999;
    }
  }
  .article-footer {
    .article-tag-wrap {
      .icon {
        margin-right: 0.2rem;
        color: #999;
      }
    }
    .article-tag-list {
      display: flex;
    }
    .article-tag-list-item {
      margin-right: 0.6rem;
      background: #f9f9f9;
      border-radius: 0.2rem;
      overflow: hidden;
      transition: 0.2s;
      &:hover {
        background: #f2f2f2;
      }
    }
    .article-tag-list-link {
      display: block;
      color: #999;
      padding: 0.36rem 0.8rem;
      font-size: 0.8rem;
      &:hover {
        &::after {
          display: none;
        }
      }
    }
  }
  .article-nav {
    margin-top: 2rem;
    width: 100%;
    &::before,
    &::after {
      content: '';
      display: table;
      clear: both;
    }
    .article-nav-title {
      display: inline-block;
    }
  }
  .article-nav-link {
    strong {
      display: block;
      color: #666;
      font-size: 0.8rem;
    }
  }
  .article-nav-prev {
    float: left;
  }
  .article-nav-next {
    float: right;
    text-align: right;
  }
  .article-footer {
    margin-top: 2rem;
  }
  .share-wrap {
    margin-top: 2rem;
    .share-btn {
      cursor: pointer;
      font-size: 0.8rem;
      .icon {
        font-size: 1rem;
        margin-right: 0.2rem;
      }
    }
    .share-list {
      margin-left: 1rem;
      font-size: 1.2rem;
    }
    .share-sns-btn {
      display: flex;
      align-items: center;
      justify-content: center;
      width: 2rem;
      height: 2rem;
      border-radius: 50%;
      border: 1px solid #efefef;
      color: #999;
      transition: 0.2s;
      &:hover {
        background: $primary;
        border-color: $primary;
        color: #fff;
        &::after {
          display: none;
        }
      }
      &.qq {
        font-size: 1rem;
      }
      & + .share-sns-btn {
        margin-left: 1rem;
      }
    }
  }
  .wx-share-modal {
    top: 24%;
    left: 50%;
    opacity: 0;
    transform: translate(-50%, -200%);
    .share-weixin-title {
      margin-bottom: 10px;
    }
    &.ready {
      visibility: 0;
      display: block;
      transform: translate(-50%, -100%);
      transition: 0.2s;
    }
    &.in {
      display: block;
      visibility: visible;
      opacity: 1;
      transform: translate(-50%);
    }
  }
}

#reward,
#rewardMask {
  display: none;
}

#reward {
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  .reward-title {
    margin-bottom: 10px;
    .icon {
      margin-right: 0.2rem;
      font-size: 1.2rem;
    }
  }
  .reward-img {
    width: 10rem;
  }
  .reward-type {
    display: block;
    text-align: center;
  }
}

.mask-wrap {
  position: fixed;
  width: 100%;
  height: 100%;
  left: 0;
  top: 0;
  background-color: rgba(0, 0, 0, 0.6);
  z-index: 999;
  display: none;
}

.modal-wrap {
  position: fixed;
  z-index: 9999;
  padding: 20px;
  text-align: center;
  color: #999;
  background: #fff;
  border-radius: 4px;
  box-shadow: 0 2px 5px 0 rgba(0, 0, 0, 0.16), 0 2px 10px 0 rgba(0, 0, 0, 0.12);
}

.modal-close {
  position: absolute;
  left: 50%;
  transform: translateX(-50%);
  bottom: -1rem;
  color: #999;
  width: 2rem;
  height: 2rem;
  font-size: 1rem;
  background: #fff;
  box-shadow: 0 3px 9px rgba(0, 0, 0, 0.2);
  border-radius: 50%;
  display: flex;
  align-items: center;
  justify-content: center;
  cursor: pointer;
  &:hover {
    &::after {
      display: none;
    }
  }
  &:active,
  &:hover {
    color: $error;
  }
}
#tocBotWrap {
  display: none;
}
.toc-bot-wrap {
  position: fixed;
  top: 0;
  right: 0;
  width: calc((100vw - 60rem) / 2 - 10px);
  height: 100vh;
  background: #fff;
  box-shadow: -1px 0 2px rgba(0, 0, 0, 0.08);
  z-index: 99;
  #tocBot {
    max-height: calc(100vh - 4rem);
    overflow-x: hidden;
    overflow-y: auto;
    @include scroll-bar($primary);
    padding-bottom: 1rem;
    position: relative;
  }
  .toc-list {
    list-style: none;
    margin-left: 0;
  }
  .toc-bot-close {
    height: 4rem;
    line-height: 4rem;
    padding-left: 1rem;
    width: 100%;
    font-size: 1.2rem;
    cursor: pointer;
    color: #999;
    &:hover {
      color: #444;
    }
  }
  .is-collapsible {
    height: auto;
    overflow: hidden;
    transition: all;
  }
  .is-collapsed {
    height: 0;
  }
  .toc-link {
    color: #888;
    height: 1.8rem;
    line-height: 1.8rem;
    width: 100%;
    display: block;
    padding-left: 1rem;
    font-size: 0.8rem;
    &:hover {
      color: #444;
      &::after {
        display: none;
      }
    }
  }
  .is-active-link {
    background: rgba($color: $primary, $alpha: 0.08);
    position: relative;
    &::before {
      position: absolute;
      left: 0;
      top: 0;
      content: '';
      width: 2px;
      height: 100%;
      background: $primary;
    }
  }
  .node-name--H2 {
    padding-left: 1rem;
  }
  .node-name--H3 {
    padding-left: 2rem;
  }
  .node-name--H4 {
    padding-left: 3rem;
  }
}

.title-state-4,
.title-state-3,
.title-state-2,
.title-state-1 {
  margin-left: 1rem;
  &::before {
    display: inline-block;
    font-size: 0.8rem;
    padding: 0.2rem 0.6rem;
    border-radius: 0.2rem;
    color: #fff;
    font-weight: 400;
  }
}
.title-state-1 {
  &::before {
    content: '开发中';
    background: rgba($color: $primary, $alpha: 0.1);
    color: darken($color: $primary, $amount: 6%);
  }
}
.title-state-2 {
  &::before {
    content: '已完成';
    background: rgba($color: $success, $alpha: 0.2);
    color: darken($color: $success, $amount: 8%);
  }
}
.title-state-3 {
  &::before {
    content: '已暂停';
    background: rgba($color: $warning, $alpha: 0.1);
    color: darken($color: $warning, $amount: 6%);
  }
}
.title-state-4 {
  &::before {
    content: '已废弃';
    background: rgba($color: $error, $alpha: 0.1);
    color: lighten($color: $error, $amount: 5%);
  }
}

