.article-entry {
  #reward-btn,
  .article-more-link {
    display: inline-block;
    color: #fff;
    margin-top: 2rem;
    margin-bottom: 2rem;
    width: 6rem;
    height: 2.4rem;
    line-height: 2.4rem;
    border-radius: 0.4rem;
    font-weight: 400;
    box-shadow: 0 3px 9px rgba($color: #000000, $alpha: 0.1);
    transition: 0.2s;
    font-size: 0.8rem;
    text-align: center;
    cursor: pointer;
    position: relative;
    overflow: hidden;
    z-index: 1;
    // 兼容QQ浏览器渐变1px空白
    &::before {
      position: absolute;
      top: 0;
      left: 0;
      content: '';
      width: 100%;
      height: 102%;
      background: linear-gradient(135deg, $primary, $green);
      z-index: -1;
      border-radius: 0.4rem;
    }
    &:hover {
      &::after {
        display: none;
      }
      box-shadow: 0 0 3px rgba($color: #000000, $alpha: 0.1) inset;
    }
  }
  #reward-btn {
    margin-left: 50%;
    transform: translateX(-50%);
    font-size: 1rem;
  }
}

#vcomments-box {
  padding: 0 !important;
  margin-top: 2rem;

  #vcomments {
    background: none !important;
  }
  .vwrap {
    background: #fff;
  }
}

sources.css\\_partical\\search.scss:
.search-form-wrap {
  width: 100%;
  position: fixed;
  top: -100%;
  right: 8rem;
  left: 0;
  opacity: 0;
  transition: 0.3s;
  z-index: 99;
  &.on {
    top: 4rem;
    opacity: 1;
  }
}
.local-search {
  position: relative;
  margin: 0 auto;
  padding: 1rem 3rem;
  background-color: rgba($color: $primary, $alpha: 0.1);
  box-shadow: 0 3px 6px rgba($color: #000000, $alpha: 0.1);
  max-height: 100vh;
  overflow-y: auto;
  border-bottom-left-radius: 0.8rem;
  border-bottom-right-radius: 0.8rem;
  @include scroll-bar($primary);
  .container {
    position: relative;
  }
}
.local-search-input {
  font-size: 1rem;
  border: 0;
  border-radius: 0.4rem;
  width: 100%;
  padding: 1rem 1.5rem;
  outline: none;
}
.local-search-input::-webkit-search-cancel-button,
.local-search-input::-webkit-search-results-decoration {
  -webkit-appearance: none;
}
.local-search-close {
  position: absolute;
  top: 0.6rem;
  right: 0.8rem;
  height: 2rem;
  width: 2rem;
  padding: 0;
  border: none;
  border-radius: 50%;
  text-align: center;
  cursor: pointer;
  background: darken($color: $primary, $amount: 5%);
  color: #fff;
  transition: 0.2s;
  &:hover {
    background: $error;
  }
}
.local-search-result {
  text-align: left;
  background:#fff;
  margin-top: 1rem;
  border-radius: 0.4rem;
}
.search-result-list {
  list-style: none;
  margin-left: 0;
  padding: 0 1rem 3.6rem 1rem;
}
.search-result-list li {
  padding: 1.5rem 0;
}
.search-result-list li:not(:last-child) {
  border-bottom: 1px solid #efefef;
}
.search-result-list li .search-result-title {
  font-size: 1.6rem;
  font-weight: 700;
}
.search-result-list li .search-result {
  padding-top: 0.5rem;
  margin: 0;
  max-height: 12rem;
  overflow: hidden;
}
.search-result-list li em.search-keyword {
  font-style: normal;
  color: #22c3c3;
}
.search-result-empty {
  padding: 2.6rem 0;
}
.search-result-empty p {
  text-align: center;
}

